import './Fees.css';
import { TfiHeadphoneAlt } from 'react-icons/tfi';

// Fees Component 
export default function ReturnSupport() {
 return (
  <div className='flex-fees'>
   <TfiHeadphoneAlt size={'2em'} />
   <h3>Assistance  24h/24 et 7j/7</h3>
   <p>
    Notre équipe est disponible à tout moment, de jour comme de nuit, pour répondre à vos questions et vous aider.
   </p>

  </div>
 );
};
